// snippets/data/images-serialized.ts
var fulingBase64 = `data:image/png;base64,`;

// snippets/populate-posting-form.ts
function deserializeFromBase64(base64) {
  const byteString = atob(base64.split(",")[1]);
  const mimeString = base64.split(",")[0].split(":")[1].split(";")[0];
  const byteArray = new Uint8Array(byteString.length);
  for (let i = 0;i < byteString.length; i++) {
    byteArray[i] = byteString.charCodeAt(i);
  }
  return new Blob([byteArray], { type: mimeString });
}
function uploadImagesInPostingForm(files) {
  const input = document.getElementById("formimages");
  if (input) {
    const dataTransfer = new DataTransfer;
    files.forEach((file) => {
      const blob = new Blob([file.fileData], { type: "image/jpeg" });
      const fileObject = new File([blob], file.fileName, { type: "image/jpeg" });
      dataTransfer.items.add(fileObject);
    });
    input.files = dataTransfer.files;
    input.dispatchEvent(new Event("change", { bubbles: true, cancelable: true }));
  } else {
    console.error("Input element not found.");
  }
}
var configurtaion = {
  postContent: `\u043F\u0440\u0438\u0432\u0435\u0442
\u043F\u043E\u043F\u0440\u043E\u0431\u0443\u0439\u0442\u0435 \u0432\u0443\u0432\u0443`,
  fileName: "fuling.png",
  threadMatchersPlainString: ["Wuthering Waves", "/ww/"],
  fileData: deserializeFromBase64(fulingBase64)
};
if (document.title.includes("Genshin Impact") || document.title.includes("/genshin/")) {
  configurtaion.threadMatchersPlainString = ["Genshin Impact", "/genshin"];
}
var openPostingForm = () => {
  document.querySelector("body > div.cntnt > header > div.header__newpost.newpost > div.newpost__wrapper > a").click();
};
var putContentInPostingForm = (content) => {
  document.getElementById("shampoo").value = content;
};
if (configurtaion.threadMatchersPlainString.find((threadMatcher) => document.title.includes(threadMatcher)) !== undefined) {
  openPostingForm();
  putContentInPostingForm(configurtaion.postContent);
  uploadImagesInPostingForm([{ fileName: configurtaion.fileName, fileData: configurtaion.fileData }]);
}
